request.description:
ðŸ“¢ Update account. The **account_id** and **account_number** are required (Note: account_number can be replaced with the label).

JSON Body is described by the following TypeScript interface.

```ts
interface UpdateAccount {
  account_id: number;
  account_number: string;
  label: string;
  provider?: boolean;
  intraco_account?: boolean;
  btp_autoliquidation?: boolean;
  exoneration?: boolean;
  society_id?: number;
  vat_param_id?: number;
  counterpart_account_id?: number;
  das_2?: boolean;
  complementary_info?: ComplementaryInfo;
}
â€‹
interface ComplementaryInfo {
  profession?: string;
  siren?: string;
  id_ape?: number;
  person_in_charge?: string;
  name?: string;
  contact_lastname?: string;
  contact_firstname?: string;
  function?: string;
  tel?: string;
  email?: string;
  iban_list?: Iban[];
  id_payment_deadline?: number;
  payment_type_id?: number;
  address_number?: string;
  repetition_index?: string;
  way_type_id?: number;
  address?: string;
  address_complement?: string;
  postal_code?: string;
  city?: string;
  country?: string;
}
â€‹
interface Iban {
  id_iban_compte_tiers: number;
  iban: string;
  bic: string;
  etablissement: string;
  rum_date_signature?: null;
}
```

ðŸ“Œ **This endpoint only work with a cabinet (firm) access**

ðŸ“¢ Company (dossier) Exercices. If an exercise is not closed **closed_at** and **closed_by** are set to `null`.

Exercices labels are `N+1`, `N`, `N-1`, `N-2` etc.

```ts
interface Exercice {
  exercice_id: number;
  start_date: string;
  label: string;
  end_date: string;
  closed: boolean;
  blocked: boolean;
  duration: number;
  result: number;
  ca: number;
  closed_at: null | string;
  closed_by: null | number;
}
```

âš ï¸ A `society-id` is required with a cabinet/firm access

